alter trigger M_T_AUDR_G3E_STYLERULE_RULE disable;
alter trigger M_T_AUD_G3E_STYLERULE_RULE disable;

declare
  TYPE numArray IS TABLE OF NUMBER INDEX BY PLS_INTEGER;
  arrSNO  numArray;
  i       PLS_INTEGER;
begin
  select distinct G3E_SNO
    bulk collect into arrSNO
    from G3E_STYLERULE
    where G3E_RULE in ('Transformer - OH Symbol', 'Transformer - OH Symbol - OMS'
                      ,'Transformer - UG Symbol', 'Transformer - UG Symbol - OMS'
                      ,'Transformer - UG Network Symbol', 'Transformer - UG Network Symbol - OMS'
                      ,'Transformer - OH Detail Symbol','Transformer - UG Detail Symbol');
  
  delete from G3E_STYLERULE where G3E_RULE = 'Transformer - OH Symbol';
  delete from G3E_STYLERULE where G3E_RULE = 'Transformer - OH Symbol - OMS';
  delete from G3E_STYLERULE where G3E_RULE = 'Transformer - UG Symbol';
  delete from G3E_STYLERULE where G3E_RULE = 'Transformer - UG Symbol - OMS';
  delete from G3E_STYLERULE where G3E_RULE = 'Transformer - UG Network Symbol';
  delete from G3E_STYLERULE where G3E_RULE = 'Transformer - UG Network Symbol - OMS';

  delete from G3E_STYLERULE where G3E_RULE = 'Transformer - OH Detail Symbol'; -- obsolete
  delete from G3E_STYLERULE where G3E_RULE = 'Transformer - UG Detail Symbol'; -- obsolete

  for i in 1..arrSNO.COUNT loop
    delete from G3E_POINTSTYLE where G3E_SNO = arrSNO(i);
    delete from G3E_STYLE where G3E_SNO = arrSNO(i);
  end loop;
end;
/

alter trigger M_T_AUDR_G3E_STYLERULE_RULE enable;
alter trigger M_T_AUD_G3E_STYLERULE_RULE enable;

